INSERT INTO `zan_pages` (`ID_Page`, `ID_User`, `ID_Translation`, `Title`, `Slug`, `Content`, `Views`, `Language`, `Principal`, `Start_Date`, `Text_Date`, `Situation`) VALUES
(6, 1, 0, 'Bienvenida', 'bienvenida', '<p style="text-align: justify;">Somos un grupo de profesionales de la medicina, la neurosicolog&iacute;a, la psicolog&iacute;a, y las ramas&nbsp; especiales de esta; que tenemos como f&iacute;n com&uacute;n el ayudar mediante el diagn&oacute;stico, el tratamiento, la limitaci&oacute;n del da&ntilde;o y la rehabilitaci&oacute;n, a los ni&ntilde;os que nos lo requieren.</p>', 0, 'Spanish', 1, 1325347608, 'Sábado, 31 de Diciembre de 2011', 'Active'),
(7, 3, 0, 'Nosotros', 'nosotros', '<p style="text-align: justify;">Somos un grupo de profesionales de la medicina, la neurosicolog&iacute;a, la educaci&oacute;n especial y profesiones afines; que tenemos como f&iacute;n com&uacute;n el ayudar mediante el diagn&oacute;stico, el tratamiento, la limitaci&oacute;n del da&ntilde;o y la rehabilitaci&oacute;n, a los ni&ntilde;os con trastornos del desarrollo, el aprendizaje y la conducta, que nos lo requieran.</p>\r\n<p style="text-align: justify;">Nuestra Misi&oacute;n</p>\r\n<p style="text-align: justify;"><br />Ser factor de cambio para los ni&ntilde;os con trastornos del neurodesarrollo, para sus familias y para su escuela.<br /><br />Facilitar una mejor integraci&oacute;n social de estos ni&ntilde;os mediante la identificaci&oacute;n y clarificaci&oacute;n de sus limitaciones y cualidades, implementando con esta base, estrategias de soluci&oacute;n<br /><br />Seremos conyuntura entre los ni&ntilde;os, su familia y su escuela.</p>\r\n<p style="text-align: justify;"><br /><br />Nuestro objetivos</p>\r\n<p style="text-align: justify;">Ser para los ni&ntilde;os, sus padres y sus escuelas, una alternativa integral y congruente, que ayude a resolver los problemas en que se ven inmersos como consecuencias de los trastornos del desarrollo infantil reflejados en: el comportamiento, el aprendizaje, la conducta, la adaptaci&oacute;n social&nbsp; y la dificultad para educarlos.<br /><br />Promover una cultura de aceptaci&oacute;n y comprensi&oacute;n solidaria para los ni&ntilde;os con caracter&iacute;sticas y necesidades especiales en su inteligencia y sus capacidades de adaptaci&oacute;n.<br /><br /><br />Tratamiento<br /><br />Terapia<br /><br />&nbsp;&nbsp;&nbsp; * Integraci&oacute;n sensorial<br />&nbsp;&nbsp;&nbsp; * Apoyo psicopedag&oacute;gico<br />&nbsp;&nbsp;&nbsp; * De atenci&oacute;n<br />&nbsp;&nbsp;&nbsp; * Visoespacial<br />&nbsp;&nbsp;&nbsp; * Reentrenamiento auditivo<br />&nbsp;&nbsp;&nbsp; * De Lenguaje comprensivo y expresivo<br /><br />M&eacute;dico<br /><br />&nbsp;&nbsp;&nbsp; * Erradicaci&oacute;n de enfermedades agravantes<br />&nbsp;&nbsp;&nbsp; * Control de exitocidade (Actividad el&eacute;ctrica anormal en el EEG)<br />&nbsp;&nbsp;&nbsp; * Inducci&oacute;n de platicidade cerebral<br />&nbsp;&nbsp;&nbsp; * Evita a m&aacute;ximo el uso de psicof&aacute;rmacos<br /><br /><br />Apoyo Emocianal<br /><br />&nbsp;&nbsp;&nbsp; * Manejo de l&iacute;mites<br />&nbsp;&nbsp;&nbsp; * Autoestima<br />&nbsp;&nbsp;&nbsp; * Terapia familiar<br />&nbsp;&nbsp;&nbsp; * Inteligencia Emocional</p>', 0, 'Spanish', 0, 1327210945, 'Domingo, 22 de Enero de 2012', 'Active'),
(8, 1, 0, 'Ubicación y Contacto', 'ubicacion-y-contacto', '<p>Contacto y Solicitud de Citas<br /><br /><br />Direcci&oacute;n: Av. Vallarta No. 3320<br /><br />Fracc. Vallarta San Jorge<br /><br />Guadalajara, Jalisco, M&eacute;xico.<br /><br /><br />Tels:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (33) 33 42 36 02<br /><br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (33) 31 21 21 94<br /><br /><br />Fax:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (33) 33 42 36 04<br /><br /><br />Email: mruiz@losruiz.com.mx Esta direcci&oacute;n electr&oacute;nica esta protegida contra spam bots. Necesita activar JavaScript para visualizarla<br /><br />prosique@prodigy.net.mx Esta direcci&oacute;n electr&oacute;nica esta protegida contra spam bots. Necesita activar JavaScript para visualizarla<br /><br /><br /><br />Ubicaci&oacute;n<br /><br />Mapa:</p>\r\n<p>\r\n<iframe marginheight="0" marginwidth="0" src="http://maps.google.com/maps?f=d&amp;source=s_d&amp;saddr=20.674639,-103.398809&amp;daddr=&amp;hl=en&amp;geocode=&amp;mra=mi&amp;mrsp=0&amp;sz=19&amp;sll=20.674631,-103.39864&amp;sspn=0.001162,0.002575&amp;ie=UTF8&amp;ll=20.674595,-103.398557&amp;spn=0.001162,0.002575&amp;output=embed" mce_src="http://maps.google.com/maps?f=d&amp;source=s_d&amp;saddr=20.674639,-103.398809&amp;daddr=&amp;hl=en&amp;geocode=&amp;mra=mi&amp;mrsp=0&amp;sz=19&amp;sll=20.674631,-103.39864&amp;sspn=0.001162,0.002575&amp;ie=UTF8&amp;ll=20.674595,-103.398557&amp;spn=0.001162,0.002575&amp;output=embed" width="425" frameborder="0" height="350" scrolling="no"></iframe><br /><small><a href="http://maps.google.com/maps?f=d&amp;source=embed&amp;saddr=20.674639,-103.398809&amp;daddr=&amp;hl=en&amp;geocode=&amp;mra=mi&amp;mrsp=0&amp;sz=19&amp;sll=20.674631,-103.39864&amp;sspn=0.001162,0.002575&amp;ie=UTF8&amp;ll=20.674595,-103.398557&amp;spn=0.001162,0.002575" mce_href="http://maps.google.com/maps?f=d&amp;source=embed&amp;saddr=20.674639,-103.398809&amp;daddr=&amp;hl=en&amp;geocode=&amp;mra=mi&amp;mrsp=0&amp;sz=19&amp;sll=20.674631,-103.39864&amp;sspn=0.001162,0.002575&amp;ie=UTF8&amp;ll=20.674595,-103.398557&amp;spn=0.001162,0.002575" style="color: rgb(0, 0, 255); text-align: left;" mce_style="color:#0000FF;text-align:left">View Larger Map</a></small>\r\n</p>\r\n', 0, 'Spanish', 0, 1324357331, 'Martes, 20 de Diciembre de 2011', 'Active'),
(9, 1, 0, 'Procedimiento de diagnostico', 'procedimiento-de-diagnostico', '<p style="text-align: justify;">Paso 1 -Historial cl&iacute;nico e hip&oacute;tesis preliminar (1ra entrevista)<br /><br />Paso 2 - Neuropsicol&oacute;gico. Evaluaci&oacute;n de funciones cerebrales superiores mediante pruebas estandarizadas.<br /><br />Paso 3 - Neurofisiol&oacute;gico. Electroencefalograma con mapeo cerebral potenciales evocados relacionados a eventos, auditivos y visuales P300, N 400, target)<br /><br />Paso 4 - M&eacute;dico. Identificaci&oacute;n de trastornos asociados que agravan y perpetuan el problema:<br /><br />&nbsp;&nbsp;&nbsp; * Transtornos del sue&ntilde;o<br />&nbsp;&nbsp;&nbsp; * Enuresis<br />&nbsp;&nbsp;&nbsp; * Obtrucci&oacute;n cr&oacute;nica de v&iacute;as respiratorias<br />&nbsp;&nbsp;&nbsp; * Estre&ntilde;imineto cr&oacute;nico&nbsp; y encropresis<br />&nbsp;&nbsp;&nbsp; * Intolerancia y alteraciones nutricionales<br />&nbsp;&nbsp;&nbsp; * S&iacute;ndrome gen&eacute;ticos.<br />&nbsp;&nbsp;&nbsp; * Etc.<br /><br /><br />Diagrama:</p>', 0, 'Spanish', 0, 1325347956, 'SÃ¡bado, 31 de Diciembre de 2011', 'Active');
